import "../styles/navbar.css"

function Navbar() {
    return (
      <div className="navbar-global">
        <div className="navbar">
          <div>Icon</div>
          <div>
            <a href="#">Catalogue</a>
            <a href="#">Search</a>
            <a href="#">Pfp</a>
          </div>
        </div>
      </div>
    );
  }
  
  export default Navbar;
